 . Dysregulated androgen receptor ( AR ) signaling is implicated in several types of tumor , including carcinomas of the prostate , breast , liver and bladder . However , the contribution of AR to the progression of upper urinary tract urothelial carcinomas ( UUTUC ) has not been fully investigated . In the present study , we demonstrated that the AR is involved in the metastasis and invasiveness of UUTUC cells . We investigated the role of the AR in UUTUC by using UUTUC-derived BFTC 909 cells . The overexpression of AR promotes the migration and invasion of BFTC 909 cells . Expression of migration / invasion-related genes was increased in BFTC 909 cells overexpressing AR determined by qPCR and western blot analyses . The results showed that AR-enhanced migration and invasion of UUTUC cells are linked to the upregulation of the matrix-degrading enzyme

<div class="entities" style="line-height: 2.5; direction: ltr">Correcting human mitochondrial mutations with targeted RNA import . Mutations in the human mitochondrial genome are implicated in neuromuscular diseases , metabolic defects , and aging . An efficient and simple mechanism for neutralizing deleterious mitochondrial DNA ( mtDNA ) alterations has unfortunately remained elusive . Here , we report that a 20 - ribonucleotide stem-loop sequence from the H1 RNA , the RNA component of the human RNase P enzyme , appended to a nonimported RNA directs the import of the resultant RNA fusion transcript into human mitochondria . The methodology is effective for both noncoding RNAs , such as tRNAs , and mRNAs . The RNA import component , polynucleotide phosphorylase ( Q8TCS8 ) , facilitates transfer of this hybrid RNA into the mitochondrial matrix . In addition , nucleus-encoded mRNAs for mitochondrial proteins , such as the mRNA of human mitochondrial ribosomal protein 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P28222
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    O15235
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) , contain regulatory sequences in their 3 ' - untranslated region ( UTR ) that confers localization to the mitochondrial outer membrane , which is postulated to aid in protein translocation after translation . We show that for some mitochondrial-encoded transcripts , such as 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P35354
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 , a 3 ' - UTR localization sequence is not required for mRNA import , whereas for corrective mitochondrial-encoded tRNAs , appending the 3 ' - UTR localization sequence was essential for efficient fusion-transcript translocation into mitochondria . In vivo , functional defects in mitochondrial RNA ( mtRNA ) translation and cell respiration were reversed in two human disease lines . Thus , this study indicates that a wide range of RNAs can be targeted to mitochondria by appending a targeting sequence that interacts with Q8TCS8 , with or without a mitochondrial localization sequence , providing an exciting , general approach for overcoming mitochondrial genetic disorders .</div>

<h2 style="margin: 0">6</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Enhanced fracture repair by leukotriene antagonism is characterized by increased chondrocyte proliferation and early bone formation : a novel role of the cysteinyl LT - 1 receptor . Inflammatory mediators and drugs which affect inflammation can influence the healing of injured tissues . Leukotrienes are potent inflammatory mediators , and similar to prostaglandins , are metabolites of arachidonic acid which can have positive or negative effects on bone and cartilage tissues . Here we tested the hypothesis that blocking the negative regulation of leukotrienes , would lead to enhanced endochondral bone formation during fracture repair . A closed femoral fracture was created in mice . Animals were divided into three groups for treatment with either montelukast sodium , a cysteinyl leukotriene type 1 receptor antagonist ( trade name Singulair ) , zileuton , a 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P09917
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 enzyme inhibitor ( trade name 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00744
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 ) , or carrier alone . The fractures were analyzed using radiographs , quantitative gene expression , histology and histomorphometry , and immunohistochemistry . Both the montelukast sodium group and the zileuton group exhibited enhanced fracture repair when compared with controls . Both treatment groups exhibited increased callous size and earlier bone formation when compared to controls as early as day 7 . Gene expression analysis of treatment groups showed increased markers of chondrocyte proliferation and differentiation , and increased early bone formation markers when compared with controls . Treatment with montelukast sodium directly targeted the cysteinyl leukotriene type 1 receptor , leading to increased chondrocyte proliferation at early time points . These novel findings suggests a potential mechanism by which the cysteinyl leukotriene type 1 receptor acts as a negative regulator of chondrocyte proliferation , with important and previously unrecognized implications for both fracture repair , and in a broader context , systemic chondrocyte growth and differentiation .</div>

 ( R1881 ) , a synthetic AR agonist , represses DB00644 expression through multiple sites in the proximal promoter . In this study , we show AR also represses DB00644 transcription via the major enhancer ( DB00644 - E1 ) . A multimer of the - 1800 / - 1766 region was repressed by R1881 treatment . Mutation of two bases , - 1792 and - 1791 , resulted in decreased basal activity and a loss of AR-mediated repression . AR bound to the - 1796 / - 1791 sequence in electrophoretic mobility shift assays , indicating a direct interaction with DNA or other transcription factors in this region . We conclude that AR repression of DB00644 - E1 acts via multiple AR-responsive regions , including the site at - 1792 / - 1791 .</div>

<h2 style="margin: 0">13</h2>

</mark>
 phosphorylation , desensitization , and ligand efficacy . Mu opioid receptors are subject to phosphorylation and desensitization through actions of at least two distinct biochemical pathways : agonist-dependent mu receptor phosphorylation and desensitization induced by a biochemically distinct second pathway dependent on protein kinase C activation ( 1 ) . To better understand the nature of the agonist-induced mu receptor phosphorylation events , we have investigated the effects of a variety of opiate ligands of varying potencies and intrinsic activities on mu receptor phosphorylation and desensitization . Exposure to the potent full agonists sufentanil , dihydroetorphine , etorphine , etonitazine , and [ D-Ala 2 , MePhe 4 , Glyol 5 ] enkephalin ( DAMGO ) led to strong receptor phosphorylation , while methadone , l-alpha-acetylmethadone ( 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ) , morphine , meperidine , DADL , beta-endorphin ( 1-31 ) , enkephalins , and dynorphin A ( 1-17 ) produced intermediate effects . The partial agonist buprenorphine minimally enhanced receptor phosphorylation while antagonists failed to alter phosphorylation . DB00921 and full antagonists each antagonized the enhanced mu receptor phosphorylation induced by morphine or DAMGO . The rank order of opiate ligand efficacies in producing mu receptor-mediated functional desensitization generally paralleled their rank order of efficacies in producing receptor phosphorylation . Interestingly , the desensitization and phosphorylation mediated by methadone and 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 were disproportionate to their efficacies in two distinct test systems . This generally good fit between the efficacies of opiates in mu receptor activation , phosphorylation , and desensitization supports the idea that activated receptor / agonist / G-protein complexes and / or receptor conformational changes induced by agonists are required for agonist-induced mu receptor phosphorylation . Data for methadone and 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 suggest possible contribution from their enhanced desensitizing abilities to their therapeutic efficacies .</div>

<h2 style="margin: 0">15</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Modulation of cytokine production and enhancement of cell viability by Q9NYK1 and Q9NR96 ligands during anthrax infection of macrophages . Inhalation of Bacillus anthracis , a bioterrorism agent , results in a high mortality rate despite appropriate antibiotic therapy . Macrophages appear to be a key factor in B . anthracis pathogenesis . The burst of pro-inflammatory cytokines from macrophages could be a major cause of death in anthrax . However , preactivation of Toll-like receptors ( TLRs ) could modify the host response . TLR ligands stimulate the release of activating cytokines but may also down-modulate the subsequent deleterious cytokine response to pathogens . We developed a cell culture model to measure macrophage responses to B . anthracis spores and bacilli . We found that germination from spores to bacilli produced a substantial stimulus for the secretion of the cytokines

 in response to B . anthracis infection of macrophages . Furthermore , the Q9NYK1 and Q9NR96 ligands significantly decreased anthrax-induced cytotoxicity in the macrophages . These findings suggest that TLR ligands may contribute to the enhancement of innate immunity in B . anthracis infection by suppressing potentially deleterious pro-inflammatory cytokine responses and by improving macrophage viability .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">The PEPvIII-KLH (

 variant III ( EGFRvIII ) is a tumor-specific mutation that is widely expressed in GBM and other neoplasms and its expression enhances tumorigenicity . This in-frame deletion mutation splits a codon , resulting in a novel glycine at the fusion junction producing a tumor-specific epitope target for cellular or humoral immunotherapy . We have previously shown that vaccination with a peptide that spans the EGFRvIII fusion junction ( PEPvIII-KLH /

<div class="entities" style="line-height: 2.5; direction: ltr">Evidence for colorectal cancer cell specificity of aspirin effects on NF kappa B signalling and apoptosis . Epidemiological evidence indicates that non-steroidal anti-inflammatory drugs ( NSAIDs ) protect against colorectal cancer ( CRC ) to a greater degree than other non-gastrointestinal cancers , but the molecular basis for this difference is unknown . We previously reported that aspirin induces signal-specific I kappa B alpha degradation followed by NF kappa B nuclear translocation in CRC cells , and that this mechanism contributes substantially to aspirin-induced apoptosis . Here , we explored the hypothesis that cell-type specific effects on NF kappa B signalling are responsible for the observed differences in protection by aspirin against CRC compared to breast and gynaecological cancers . We also assessed whether

 , beta-catenin , p53 and DNA
